import { BrowserRouter, Route} from "react-router-dom";
import HOme from "./home";
import Favori from "./favoris";
import Navb from './nav';


function App() {
  return (
    <div>
      <BrowserRouter>
        <Navb />
          <Route path="/" component={HOme} />
          <Route path="/favoris" component={Favori} />
      </BrowserRouter>
     {/* <Navb />
